import React,{Component} from 'react';
import './Myheaderstyle.css';

class Myheader extends Component {

    constructor(props) {
        super(props);
    }
    
    render() {

        return (
            <div className="Myheader">
                    <div className="headder_element">
                        <div>现有确诊</div>
                        <div>534</div>
                        <div>昨日 +12</div>
                    </div>
                    <div className="headder_element">
                        <div>累计确诊</div>
                        <div>534</div>
                        <div>昨日 +12</div>
                    </div>
                    <div className="headder_element">
                        <div>累计治愈</div>
                        <div>600</div>
                        <div>昨日 +12</div>
                    </div>
                    <div className="headder_element">
                        <div>累计死亡</div>
                        <div>4</div>
                        <div>昨日 +0</div>
                    </div>
            </div>
        )
    }
}

export default Myheader;
